import React, { useState } from "react";
import { useDisclosure } from "@mantine/hooks";
import {
  Box,
  Center,
  Stack,
  Flex,
  ActionIcon,
  Autocomplete,
  rem,
  Avatar,
  Text,
  Button,
  LoadingOverlay,
} from "@mantine/core";
import {
  IconHome2,
  IconUser,
  IconMessageCircle,
  IconBookmark,
  IconAlignLeft,
  IconSearch,
  IconCircleXFilled,
  IconBell,
} from "@tabler/icons-react";

const ResponsivePhone = () => {
  const [visible, { toggle }] = useDisclosure(true);
  const [selectedBlackIcon, setSelectedBlackIcon] = useState(null);

  const handleBlackIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedBlackIcon(index);
  };

  const blackicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconBookmark", component: <IconBookmark /> },
    { name: "IconUser", component: <IconUser /> },
  ];

  return (
    <Stack>
      <Center>
        <Box
          className="responsive-phone"
          pos="relative"
          style={{
            position: "relative",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            maxWidth: "250px",
            width: "250px",
            height: "500px",
            backgroundColor: "var(--mantine-color-gray-0)",
            border: "2px solid var(--mantine-color-dark-9)",
            borderRadius: "18px",
            boxShadow: "5px 5px 10px rgba(0, 0, 0, 0.5)",
          }}
        >
          <Box
            bg="dark.9"
            style={{
              width: "100%",
              height: "30px",
              borderRadius: "15px 15px 0px 0px",
            }}
          >
            <Center mt="xs">
              <Box
                bg="white"
                style={{
                  width: "50px",
                  height: "5px",
                  borderRadius: "15px 15px 15px 15px",
                }}
              />
            </Center>
            {/* This is the first Box with a height of 50px */}
          </Box>
          <Box
            bg="gray.1"
            style={{
              flex: 1,
              width: "100%",
              position: "relative",
              display: "flex",
              flexDirection: "column",
            }}
          >
            <LoadingOverlay
              visible={visible}
              zIndex={1000}
              overlayProps={{ radius: "0", blur: 2 }}
              loaderProps={{ color: "pink", type: "bars" }}
              style={{
                position: "absolute",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            />
            <Flex
              mih={50}
              gap="xs"
              justify="center"
              align="center"
              direction="row"
              wrap="wrap"
              style={{
                borderBottom: "1px solid var(--mantine-color-dark-9)"
              }}
            >
              <IconAlignLeft />
              <Box
                bg="gray.1"
                p={3}
                c={`gray.4`}
                style={{
                  width: "150px",
                  backgroundColor: 'var(--mantine-color-gray-0)',
                  border: "1px solid var(--mantine-color-gray-4)",
                  borderRadius: "15px",
                }}
              >
                <Flex
                  gap="xs"
                  justify="flex-start"
                  align="center"
                  direction="row"
                  wrap="wrap"
                >
                  <IconSearch
                    style={{ width: rem(16), height: rem(16) }}
                    stroke={1.5}
                  />
                  <Text>Search</Text>
                </Flex>
              </Box>
              <Avatar bg="var(--mantine-color-gray-0)" radius="xl">
                <IconBell />
              </Avatar>
            </Flex>
            <Flex
              style={{ flex: 1, background: "var(--mantine-color-gray-0)" }}
              // Add any styles for the middle section here
            />
            <Flex
              mih={50}
              bg="dark.9"
              justify="space-around"
              align="center"
              direction="row"
              wrap="wrap"
              style={{
                padding: "10px",
              }}
            >
              {blackicons.map((blackicon, index) => (
                <ActionIcon
                  bg="dark.9"
                  radius="md"
                  key={index}
                  variant={selectedBlackIcon === index ? "transparent" : ""}
                  aria-label={`Icon ${blackicon.component}`}
                  onClick={() => handleBlackIconClick(index, blackicon)}
                >
                  {blackicon.component}
                </ActionIcon>
              ))}
            </Flex>
          </Box>

          <Box
            bg="dark.9"
            style={{
              width: "100%",
              height: "30px",
              borderRadius: "0px 0px 15px 15px",
            }}
          >
            {/* This is the last Box with a height of 50px */}
            <Center mt="xs">
              <Box
                bg="white"
                style={{
                  width: "50px",
                  height: "5px",
                  borderRadius: "15px 15px 15px 15px",
                }}
              />
            </Center>
          </Box>
        </Box>
      </Center>
    </Stack>
  );
};

export default ResponsivePhone;
